import React from 'react'
import {Row, Col} from 'react-bootstrap'
import products  from '../products'


export const HomeScreen = () => {
    return (
        <>
            <h1>List of Products</h1>
            <Row>
                {products.map( product => (
                        <Col sm={12} md={6} lg={12} xl={3}>
                            <h3>{product.name}</h3>
                        </Col>         
                ))}

                
            </Row>
            
        </>
    )
}
